import React, {PureComponent} from 'react';
import {Form, Input, Tabs} from "antd";
import {withRouter} from "react-router";

import {COLORS} from "../../resource/constant";
import loginStyle from './index.module.css';
import {VerifiedOutlined} from "@ant-design/icons";

const {TabPane}=Tabs;

class Login extends PureComponent {

    render() {
        return (
            <div className={loginStyle.login}>
                <Tabs type='card' size='large' animated={{inkBar:true,tabPane:true}}>
                    <TabPane tab='企业成员登录' key='member'>
                        <Form wrapperCol={{span:24}} style={{marginTop:'10px'}}>
                            <Form.Item name='identity'>
                                <Input prefix={<VerifiedOutlined />} placeholder='请输入企业唯一标识'/>
                            </Form.Item>
                            <Form.Item name='uid'>
                                <Input placeholder='请输入登录账号'/>
                            </Form.Item>
                            <Form.Item name='pwd'>
                                <Input placeholder='请输入登录密码'/>
                            </Form.Item>
                        </Form>
                    </TabPane>
                    <TabPane tab='企业管理员登录' key='administrator'>

                    </TabPane>
                </Tabs>
            </div>
        );
    }

}

export default withRouter(Login);
